import Link from 'next/link';
import { Fragment } from 'react';

import Favorite from '../../../pages/auth/favorite';


const navigation = (props)=> (
   <Fragment> 
        <Link href="/">
            <a>This is Home page</a>
        </Link>
        <Link href="/Favorite">
            <a>This is Home page</a>
        </Link>
    </Fragment> 
);

export default navigation;
